import React, { useEffect } from "react";

import "./App.css";
import Router from "./components/Router";

function App() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
  return (
    <div className="App">
      <Router />
    </div>
  );
}

export default App;
